import classes from "./Dialogue.module.css"

const Dialogue = () => {
    return(
      <div className={classes.alldialogues}>
          <div className={classes.con}>
              <div className={classes.block}>
          <div className={classes.user}><img className={classes.prof} src='https://images.unsplash.com/photo-1611915387288-fd8d2f5f928b?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=1080&fit=max'></img>
Vlad</div>
          </div>

          <div className={classes.user}>Andriy</div>
          <div className={classes.user}>Leha</div>
          <div className={classes.user}>Morgenshtern</div>
          </div>
      </div>
    );
}

export default Dialogue;
